import React from "react";
import './logIn.css';

const Form = () => {

    return (
        <form onSubmit={SubmitHandler}>
      <div>
        <div>
          <label>Username</label>
          <input type="text"/>
        </div>
        <div>
          <label>Amount</label>
          <input type="number"/>
        </div>
      </div>
      <div>
        <button type="submit">Add User</button>
      </div>
    </form>
    );
}

export default Form;
